import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import './Dashboard.css';

function TrainerProfile() {
  const { id } = useParams();
  const [trainer, setTrainer] = useState(null);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch(`http://localhost:8000/trainers/${id}`)
      .then(res => res.json())
      .then(data => {
        setTrainer(data);
        setLoading(false);
      });
  }, [id]);

  if (loading) {
    return (
      <div className="dashboard-loading">
        <div className="loading-spinner"></div>
        <p>กำลังโหลด...</p>
      </div>
    );
  }

  if (!trainer || trainer.detail) {
    return <div className="dashboard-loading"><p>ไม่พบข้อมูล Trainer</p></div>;
  }

  // Mock data for layout preview
  const traineeList = trainer.trainee_list || [
    { id: 1, name: 'B1', email: 'B1@email.com' },
    { id: 2, name: 'B2', email: 'B2@email.com' },
  ];
  const videoList = trainer.video_list || [
    { id: 1, title: 'Cardio เบื้องต้น', url: '#' },
    { id: 2, title: 'Weight Training', url: '#' },
  ];

  return (
    <div className="dashboard">
      <nav className="dashboard-nav">
        <div className="dashboard-logo">FitAddict</div>
        <div className="dashboard-user">
          {trainer.picture && (
            <img src={trainer.picture} alt="Profile" className="user-avatar" />
          )}
          <span className="user-name" style={{ fontWeight: 700, fontSize: "1.1rem", color: "#1e293b" }}>
            {trainer.name}
          </span>
        </div>
      </nav>
      <main className="dashboard-main">
        <div className="dashboard-welcome">
          <h1>โปรไฟล์ Trainer: {trainer.name}</h1>
          <p>: {trainer.points}</p>
          <p>: {trainer.streak}</p>
        </div>
        <div className="dashboard-section" style={{marginTop: 32}}>
          <h2>รายชื่อลูกเทรน (Trainee List)</h2>
          <table className="trainee-table" style={{width: '100%', marginBottom: 24}}>
            <thead>
              <tr>
                <th>ID</th>
                <th>ชื่อ</th>
                <th>Email</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {traineeList.map(t => (
                <tr key={t.id}>
                  <td>{t.id}</td>
                  <td>{t.name}</td>
                  <td>{t.email}</td>
                  <td>
                    <button style={{marginRight: 8}}>Hide</button>
                    <button style={{marginRight: 8}}>Show</button>
                    <button style={{color: 'red'}}>Suspend</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
        <div className="dashboard-section">
          <h2>วิดีโอที่โพสต์ (Video List)</h2>
          <table className="trainee-table" style={{width: '100%', marginBottom: 24}}>
            <thead>
              <tr>
                <th>ID</th>
                <th>ชื่อวิดีโอ</th>
                <th>ลิงก์</th>
                <th>สถานะ</th>
                <th>Action</th>
              </tr>
            </thead>
            <tbody>
              {videoList.map(v => (
                <tr key={v.id}>
                  <td>{v.id}</td>
                  <td>{v.title}</td>
                  <td>
                    <a href={v.url} target="_blank" rel="noopener noreferrer">ดูวิดีโอ</a>
                  </td>
                  <td>
                    <select defaultValue={v.status || 'public'} style={{padding: '4px 8px'}}>
                      <option value="public">Public</option>
                      <option value="private">Private</option>
                    </select>
                  </td>
                  <td>
                    <button style={{color: 'red'}}>Suspend</button>
                  </td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </main>
    </div>
  );
}

export default TrainerProfile;
